import React from "react";
import {
  BrowserRouter as Router,
  Route,

} from "react-router-dom";



import './App.css';
import Header from './components/Header'
import NotesListPages from './pages/NotesListPages'
function App() {
  return (
    <Router>

        <div className="App">

            <Header />
             <Switch>
          <Route path="/">
            <NotesListPages />
          </Route>
          <Route path="/users">
            <Users />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>

        </div>

    </Router>
  );
}

export default App;
